import React, { useEffect } from 'react';
import s from './App.module.scss';
import Header from './components/Header/Header';
import Game from './components/Game/Game';
import { useDispatch } from 'react-redux';
import { getHistory } from './Redux/reducers/historySlice';
import { getMarkets } from './Redux/reducers/marketSlice';
import { getFrequency } from './Redux/reducers/frequencySlice';
import { getLimits } from './Redux/thunks/limitsThunks';

const App = () => {
  const dispatch = useDispatch();
  dispatch(getHistory());
  dispatch(getMarkets());
  // dispatch(get);
  dispatch(getFrequency());
  // dispatch(getLimits());

  const loop = () => {
    setInterval(() => {
      dispatch(getHistory());
    }, 60000);
  };

  useEffect(() => {
    loop();
  }, []);

  useEffect(() => {
    dispatch(getLimits());
  }, [dispatch]);

  return (
    <div className={s.app}>
      <Header />
      <Game />
    </div>
  );
};

export default App;
